import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Escritorio.css';

const Escritorio = () => {
    const [triaje, setTriaje] = useState([]);
    const [plan, setPlan] = useState([]);

    useEffect(() => {
        const fetchTriaje = async () => {
            try {
                const response = await axios.get('http://localhost:3002/api/escritorio/listarTriaje');
                setTriaje(response.data);
            } catch (error) {
                console.error('Error fetching triaje data:', error);
            }
        };

        const fetchPlan = async () => {
            try {
                const response = await axios.get('http://localhost:3002/api/escritorio/listarPlan');
                setPlan(response.data);
            } catch (error) {
                console.error('Error fetching plan data:', error);
            }
        };

        fetchTriaje();
        fetchPlan();
    }, []);

    return (
        <div className="escritorio-container">
            <div className="table-container">
                <h2>Triaje</h2>
                <table>
                    <thead>
                    <tr>
                        <th>#</th>
                        <th>Triaje</th>
                    </tr>
                    </thead>
                    <tbody>
                    {triaje.map((item, index) => (
                        <tr key={index}>
                            <td><span className="label bg-green">{index + 1}</span></td>
                            <td>{item.paciente}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
            <div className="table-container">
                <h2>Plan</h2>
                <table>
                    <thead>
                    <tr>
                        <th>#</th>
                        <th>Atenci√≥n</th>
                    </tr>
                    </thead>
                    <tbody>
                    {plan.map((item, index) => (
                        <tr key={index}>
                            <td><span className="label bg-red">{index + 1}</span></td>
                            <td>{item.paciente}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default Escritorio;
